import logo from './logo.svg';
import './App.css';
import NewReleasePhoto from './images/release.jpg'
import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faInstagram, faSoundcloud, faTiktok } from '@fortawesome/free-brands-svg-icons';


// Navigation component

const Navigation = () => {
  return (
    <div>
      <nav className="navigation-container">
        <ul className="navigation-list">
          <li><a href="#news">News</a></li>
          <li><a href="#about">About</a></li>
          <li><a href="#music">Music</a></li>
        </ul>
      </nav>
      <div className="content">
        {/* Add your content here */}
      </div>
      <footer className="footer-container">
        <div className="social-icons">
          <a href="https://www.instagram.com/nansea_music">
            <FontAwesomeIcon icon={faInstagram} />
          </a>
          <a href="https://soundcloud.com/nansea_music">
            <FontAwesomeIcon icon={faSoundcloud} />
          </a>
          <a href="https://www.tiktok.com/@_nansea">
            <FontAwesomeIcon icon={faTiktok} />
          </a>
        </div>
      </footer>
    </div>
  );
};

// Main section components
// a main function for the entire body 


const body = () => {
  const News = () => {
    return (
      <section id="news">
      <h2>News</h2>
      <ul>
        <li>
          <div>
          <h3>Upcoming Single Release 2023</h3>
           <img src={NewReleasePhoto} alt="new release teaser" />
              <div id="news-content">
                <p>There will be a new single, yey!</p>
              </div>
              <div id="news-description">
                <p><i>Kindness</i> is a song about ... </p>
              </div>
          </div>
        </li>
      </ul>
    </section>
    );
  };

  const About = () => {
    return (
      <section id="about">
        <p> Nansea (ˈnænsi) takes her name from a homophobic slur, reclaiming then
  submerging it in a cooling balm of polyphonic fractals, waves of synth crashing
  against 80’s-inspired drum machines, and the lull of a calm ocean on a moonlit
  night. Above it all floats the glide and glitter of the wonderous voice of Marek
  Polgesek (he/she/they), a voice both so settled and grasping, ecstatic and full, that
  it defies genre and gender boundaries—existing in a secret realm between Rosalia
  and Ravel.
  Polish-born, but raised in a small German town after their family relocated—a time
  also marked by the loss of her father—Nansea eventually found himself in Berlin,
  buffeted by swells of techno, operatic arias, and the internationalist artists of the
  queer and pop strata of the capital.
  Performances rippled out in wider concentric circles, from the bars and theatres of
  Kreuzkölln, to Berlin institutions like HKW, Berghain Kantine, and Torstrassen
  Festival. Collaborations with poets, musicians, and dancers flowed into work with
  the queer club collective GOLOSA, as well as with Colin Self and others on the
  2021 Sheena McGrandles project Dawn. A lyrical focus on themes of community,
  the queer experience, and the dismantling of gender has manifested itself in a fluid
  and evolving style, shifting from 2019’s Comfort EP, recorded with a neo-baroque
  quintet, to their current work, undulating solo arrangements of synth and bass,
  opening up an untapped ocean of sound that pulses with an unchecked rhythm. </p> 
      </section>
    );
  };


  const Music = () => {
    return (
      <section id="music">
        <div id="soundcloud-player">
          /* HIER KOMMT SPOTIFY ODER SOUNDCLOUD PLAYER  */ 
        </div>
      </section>
    );
  };

  // Footer component
  const Footer = () => {
    return (
      <footer>
        <section>
          {/* Impressum content */}
        </section>
        <p>&copy; {new Date().getFullYear()} Nansea. All rights reserved.</p>
      </footer>
    );
  };

  // Main component representing the entire page
  const ArtistPage = () => {
    return (
      <div>
        <Navigation />
        <main>
          <News />
          <Music />
          <About />
        </main>
        <Footer />
      </div>
    );
  };
}


export default ArtistPage;
